import{_ as t,o as e,c as i,e as s}from"./chunks/framework.78e651f5.js";const o="/assets/logo1-1-300x258.ef05ea19.jpg",f=JSON.parse('{"title":"Гуслица ищет организатора открытой мастерской","description":"","frontmatter":{"title":"Гуслица ищет организатора открытой мастерской","date":"2019-03-01","categories":["process"],"tags":["guslitsa"],"cover":"944609_1695052900634774_1276603972_n.jpg"},"headers":[],"relativePath":"practice/event/guslitsa/index.md","filePath":"practice/event/guslitsa/index.md"}'),a={name:"practice/event/guslitsa/index.md"},l=s('<p><img src="'+o+'" alt="logo1"></p><p>Творческая усадьба &quot;Гуслица&quot; приглашает к себе в команду руководителя проекта открытых мастерских! Разыскивается человек, готовый взять на себя многозадачный процесс запуска работы открытых мастерских, пользуясь существующей концепцией, разработанной непосредственно для пространства усадьбы.</p><p>Необходимо обеспечивать, отслеживать и поддерживать реализацию существующей концепции открытых мастерских в помещении усадьбы на месте.</p><p>Что подразумевает деятельность руководителя:</p><ul><li>поиск мастеров и лиц, заинтересованных в становлении мастерских,</li><li>курирование процесса обустройства мастерских согласно имеющейся концепции,</li><li>решение возникающих организационных вопросов.</li></ul><p>Что предоставляет &quot;Гуслица&quot;:</p><ul><li>руководителю будет предоставлена регулярная консультация и поддержка в вопросах организации работы мастерской,</li><li>проживание и питание в усадьбе &quot;Гуслица&quot;,</li><li>на первых порах проект предполагает деятельность в качестве волонтера, после открытия мастерских руководитель сможет зарабатывать в проекте.</li></ul>',7),_=[l];function c(p,n,r,u,d,g){return e(),i("div",null,_)}const x=t(a,[["render",c]]);export{f as __pageData,x as default};
